import React, { useState, useEffect } from 'react';
import { isWeChat } from '../utils'

import {
  PaySdk,
  IsVipUserResult,
  ApiOrderRightResult,
  ApiCreateOrderResult
} from '@kkb/kmos-paysdk-utils';

interface PropsType {
  appid: string;
  openid: string;
  unionid: string;
  userId: number;
  mobile: string;
  courseCode: string;
  channelCode: string;
  sell?: number;
}

const useInit = ({
  appid,
  openid,
  unionid,
  courseCode,
  channelCode,
  userId,
  mobile,
  sell
}: PropsType) => {

  const [rightData, setRightData] = useState<ApiOrderRightResult | null>(null);
  const [getOrderData, setOrderObj] = useState<ApiCreateOrderResult | null>(null)

  const getInit = async() => {
    const isVipData = await PaySdk.getIsVipUser<IsVipUserResult>({
      params: {
        userId
      }
    })
    const isVipUser = isVipData && isVipData.status === 0 ? true : false
    const data = await PaySdk.getOrderRights<ApiOrderRightResult>({
      params: {
        userId,
        orderStrategy: 1,
        isVipUser: isVipUser ? 1 : 0,
        courseCode,
        channelCode
      },
    })
    console.log(data, 'data')
    setRightData(data)
    const orderData = await PaySdk.postCreateOrder<ApiCreateOrderResult>({
      params: {
        courseCode,
        channelCode,
        openid,
        unionid,
        user_id: userId,
        appid,
        appOpenid: appid,
        passback_params: '{}',
        mobile,
        buyerId: userId,
        orderStrategy: sell && Number(sell) === 1 ? 2 : 1,
        returnUrl: '',
        endpoint: isWeChat ? 'WX' : 'PE-H5',
        isCashier: 1,
        checkedRightsCode: 0,
        isVipUser
      }
    })
    console.log(orderData, 'orderData')
    setOrderObj(orderData)
  }

  useEffect(() => {
    getInit()
  }, [])

  return {
    rightData,
    getOrderData
  }
}

export default useInit
